import React, {Component} from 'react'
import './style.css'
import Hidden from '@material-ui/core/Hidden';


export default class Menu extends Component{
    render(){
        return(
            <div className="lista">
                <Hidden xsDown>
                <ul>
                    <li><p>Recentes</p></li>
                    <li><p>Inteligencia Artificial</p></li>
                    <li><p>Formula 1</p></li>
                    <li><p>Apollo 11</p></li>
                    <li><p>Nikolas Tesla</p></li>
                    <li><p>Copa do Mundo FIFA de 2002</p></li>
                </ul>
                </Hidden>
            </div>
        );
    }
}
